function isValidHost(urlString) {
  const url = new URL(urlString);
  return url.hostname === 'connect.garmin.com';
}

function gotoGarminBadges() {
  const { redirect } = Host.getFunctions();
  const mem = Memory.fromString('https://connect.garmin.com/');
  redirect(mem.offset);
}

function start() {
  if (!isValidHost(Config.get('tabUrl'))) {
    gotoGarminBadges();
    Host.outputString(JSON.stringify(false));
    return;
  }
  Host.outputString(JSON.stringify(true));
}

function two() {
  const cookies = JSON.parse(Config.get('cookies'))['connect.garmin.com'];
  const headers = JSON.parse(Config.get('headers'))['connect.garmin.com'];

  console.log("TLSN cookies");
  console.log(JSON.stringify(cookies));
  console.log("TLSN headers");
  console.log(JSON.stringify(headers));

  const JWT_FGP = cookies['JWT_FGP']
  const auth = headers['authorization']

  console.log("JWT_FGP");
  console.log(JSON.stringify(JWT_FGP));
  console.log("auth");
  console.log(JSON.stringify(auth));

  if (!JWT_FGP || !auth) {
    Host.outputString(JSON.stringify(false));
    return;
  }

  Host.outputString(
    JSON.stringify({
      url: 'https://connect.garmin.com/badge-service/badge/earned',
      method: 'GET',
      headers: {
        'di-backend': 'connectapi.garmin.com',
        Host: 'connect.garmin.com',
        authorization: headers.authorization,
        Cookie: `JWT_FGP=${JWT_FGP}`,
        'Accept-Encoding': 'identity',
        Connection: 'close',
      },
      secretHeaders: [
        `cookie: JWT_FGP=${JWT_FGP}`,
        `authorization: ${headers.authorization}`,
      ],
    }),
  );
}

function parseResp() {
  const secretResps = [];
  Host.outputString(JSON.stringify(secretResps));
}

function three() {
  const params = JSON.parse(Host.inputString());
  const { notarize } = Host.getFunctions();

  if (!params) {
    Host.outputString(JSON.stringify(false));
  } else {
    const mem = Memory.fromString(JSON.stringify({
      ...params,
      getSecretResponse: 'parseResp',
    }));
    const idOffset = notarize(mem.offset);
    const id = Memory.find(idOffset).readString();
    Host.outputString(JSON.stringify(id));
  }
}

function config() {
  Host.outputString(
    JSON.stringify({
      title: 'Garmin badges',
      description: 'Notarize ownership of Garmin Badges',
      icon: 'data:image/png;base64,',
      steps: [
        {
          title: 'Visit Garmin Connect website',
          cta: 'Go to connect.garmin.com',
          action: 'start',
        },
        {
          title: 'Collect credentials',
          description: "Login to your account if you haven't already",
          cta: 'Check cookies',
          action: 'two',
        },
        {
          title: 'Notarize badges',
          cta: 'Notarize',
          action: 'three',
          prover: true,
        },
      ],
      hostFunctions: ['redirect', 'notarize'],
      cookies: ['connect.garmin.com'],
      headers: ['connect.garmin.com'],
      requests: [
        {
          url: 'https://connect.garmin.com/badge-service/badge/earned',
          method: 'GET',
        },
      ],
    }),
  );
}

module.exports = { start, config, two, three, parseResp };
